import {
  useState
} from "react";

const Header = ({userData})=>{
  console.log(userData);
  const design = (
    <h1>Header</h1>
  );
  return design;
}

const Footer = (data)=>{
  const design = (
    <h1>Footer</h1>
  );
  return design;
}

const Hooks = ()=>{
  const data = {
    name: 'aftab',
    roll: 3
  }
  const design = (
    <>
      <Header userData = {data}/>
      <Footer userData = {data}/>
    </>
  );
  return design;
}

export default Hooks;
